DROP TABLE IF EXISTS wp_2315_fng_comments;

CREATE TABLE `wp_2315_fng_comments` (
  `comment_id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `request_id` bigint(20) unsigned NOT NULL,
  `author_id` bigint(20) unsigned NOT NULL,
  `comment_content` text COLLATE utf8mb4_unicode_520_ci NOT NULL,
  `comment_date` datetime NOT NULL,
  `comment_status` tinyint(1) unsigned NOT NULL,
  PRIMARY KEY (`comment_id`),
  KEY `request_id` (`request_id`),
  KEY `author_id` (`author_id`),
  KEY `comment_date` (`comment_date`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_520_ci;




DROP TABLE IF EXISTS wp_2315_fng_requests;

CREATE TABLE `wp_2315_fng_requests` (
  `request_id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `author_id` bigint(20) unsigned NOT NULL,
  `task_id` bigint(20) unsigned NOT NULL,
  `request_content` text COLLATE utf8mb4_unicode_520_ci NOT NULL,
  `request_price` int(20) unsigned NOT NULL,
  `request_date` datetime NOT NULL,
  `parent_id` bigint(20) unsigned NOT NULL,
  `request_status` tinyint(1) unsigned NOT NULL,
  PRIMARY KEY (`request_id`),
  KEY `author_id` (`author_id`),
  KEY `task_id` (`task_id`),
  KEY `parent_id` (`parent_id`),
  KEY `request_date` (`request_date`),
  KEY `request_status` (`request_status`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_520_ci;




DROP TABLE IF EXISTS wp_commentmeta;

CREATE TABLE `wp_commentmeta` (
  `meta_id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `comment_id` bigint(20) unsigned NOT NULL DEFAULT '0',
  `meta_key` varchar(255) COLLATE utf8mb4_unicode_520_ci DEFAULT NULL,
  `meta_value` longtext COLLATE utf8mb4_unicode_520_ci,
  PRIMARY KEY (`meta_id`),
  KEY `comment_id` (`comment_id`),
  KEY `meta_key` (`meta_key`(191))
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_520_ci;

