INSERT INTO wp_options VALUES("148","rcl_active_addons","a:19:{s:13:\"rating-system\";a:8:{s:4:\"name\";s:47:\"Rating System (Система рейтинга)\";s:7:\"version\";s:5:\"3.1.0\";s:12:\"support-core\";s:6:\"16.0.0\";s:11:\"description\";s:54:\"Рейтинговая система для wp-recall\";s:6:\"author\";s:25:\"Плечев Андрей\";s:3:\"url\";s:20:\"http://codeseller.ru\";s:4:\"path\";s:95:\"/homepages/0/d796185123/htdocs/findmaster/web/wp-content/plugins/wp-recall/add-on/rating-system\";s:8:\"priority\";i:0;}s:7:\"profile\";a:9:{s:4:\"name\";s:49:\"Profile (Профиль пользователя)\";s:7:\"version\";s:5:\"3.0.0\";s:12:\"support-core\";s:6:\"16.0.0\";s:11:\"description\";s:94:\"Расширение настроек профиля пользователя для wp-recall\";s:6:\"author\";s:25:\"Плечев Андрей\";s:10:\"author-uri\";s:21:\"http://codeseller.ru/\";s:10:\"add-on-uri\";s:109:\"http://codeseller.ru/products/profile-recall-upravlenie-profilem-polzovatelya-na-sajte-s-pomoshhyu-wp-recall/\";s:4:\"path\";s:89:\"/homepages/0/d796185123/htdocs/findmaster/web/wp-content/plugins/wp-recall/add-on/profile\";s:8:\"priority\";i:0;}s:8:\"rcl-chat\";a:9:{s:4:\"name\";s:17:\"Rcl Chat (Чат)\";s:7:\"version\";s:5:\"2.0.0\";s:12:\"support-core\";s:6:\"16.0.0\";s:11:\"description\";s:68:\"Приватные сообщения wp-recall и общий чат\";s:6:\"author\";s:25:\"Плечев Андрей\";s:10:\"author-uri\";s:21:\"http://codeseller.ru/\";s:10:\"add-on-uri\";s:40:\"https://codeseller.ru/products/rcl-chat/\";s:4:\"path\";s:90:\"/homepages/0/d796185123/htdocs/findmaster/web/wp-content/plugins/wp-recall/add-on/rcl-chat\";s:8:\"priority\";i:0;}s:12:\"user-balance\";a:8:{s:4:\"name\";s:36:\"User balance (Личный счет)\";s:7:\"version\";s:5:\"4.0.0\";s:12:\"support-core\";s:6:\"16.0.0\";s:11:\"description\";s:512:\"Дополнение позволяющее использовать на сайте личный счет пользователя. Может понадобиться для работы некоторых других дополнений, использующих личный счет пользователя. Используется для подключения к Робокассе или Интеркассе. Личный счет пользователя выводится через виджет.\";s:6:\"author\";s:25:\"Плечев Андрей\";s:3:\"url\";s:20:\"http://codeseller.ru\";s:4:\"path\";s:94:\"/homepages/0/d796185123/htdocs/findmaster/web/wp-content/plugins/wp-recall/add-on/user-balance\";s:8:\"priority\";i:0;}s:10:\"publicpost\";a:9:{s:4:\"name\";s:33:\"PublicPost (Публикация)\";s:7:\"version\";s:5:\"4.0.0\";s:12:\"support-core\";s:6:\"16.0.0\";s:11:\"description\";s:168:\"Дайте возможность посетителям вашего сайта публиковать свои записи с помощью плагина wp-recall\";s:6:\"author\";s:25:\"Плечев Андрей\";s:10:\"author-uri\";s:21:\"http://codeseller.ru/\";s:10:\"add-on-uri\";s:95:\"http://codeseller.ru/products/public-recall-publikaciya-zapisej-na-sajte-s-pomoshhyu-wp-recall/\";s:4:\"path\";s:92:\"/homepages/0/d796185123/htdocs/findmaster/web/wp-content/plugins/wp-recall/add-on/publicpost\";s:8:\"priority\";i:0;}s:15:\"reviews-advance\";a:10:{s:4:\"name\";s:15:\"Reviews Advance\";s:12:\"parent-addon\";s:13:\"rating-system\";s:7:\"version\";s:5:\"1.2.0\";s:12:\"support-core\";s:7:\"16.16.0\";s:7:\"item-id\";s:5:\"17868\";s:11:\"description\";s:244:\"Система отзывов, позволяющая пользователям оставлять отзывы к различным объектам и сущностям. Работает на основе дополнения Rating System\";s:6:\"author\";s:25:\"Плечёв Андрей\";s:10:\"author-uri\";s:21:\"http://codeseller.ru/\";s:4:\"path\";s:89:\"/homepages/0/d796185123/htdocs/findmaster/web/wp-content/wp-recall/add-on/reviews-advance\";s:8:\"priority\";i:1;}s:12:\"money-wallet\";a:10:{s:4:\"name\";s:62:\"Money Wallet Wp-Recall (Продвинутый кошелек)\";s:12:\"parent-addon\";s:12:\"user-balance\";s:7:\"version\";s:5:\"2.6.4\";s:7:\"item-id\";s:4:\"4789\";s:12:\"support-core\";s:7:\"16.17.0\";s:11:\"description\";s:490:\"Дополнение позволяет пользователям более гибко управлять средствами на своем личном счету на сайте. Становятся возможными переводы средств между пользователями и запросы на вывод средств с личного счета. Для работы требуется дополнение личного счета пользователя.\";s:6: