INSERT INTO wp_posts VALUES("13","1","2019-08-28 22:03:34","2019-08-28 22:03:34","/**\n* Disable WP 4.2 emoji\n*/\nfunction ace_remove_emoji() {\n	add_filter( \'emoji_svg_url\', \'__return_false\' );\n	remove_action( \'admin_print_styles\', \'print_emoji_styles\' );\n	remove_action( \'wp_head\', \'print_emoji_detection_script\', 7 );\n	remove_action( \'admin_print_scripts\', \'print_emoji_detection_script\' );\n	remove_action( \'wp_print_styles\', \'print_emoji_styles\' );\n	remove_filter( \'wp_mail\', \'wp_staticize_emoji_for_email\' );\n	remove_filter( \'the_content_feed\', \'wp_staticize_emoji\' );\n	remove_filter( \'comment_text_rss\', \'wp_staticize_emoji\' );\n	// filter to remove TinyMCE emojis\n	add_filter( \'tiny_mce_plugins\', \'ace_disable_emoji_tinymce\' );\n}\nadd_action( \'init\', \'ace_remove_emoji\' );\n/**\n* Remove tinyMCE emoji\n*/\nfunction ace_disable_emoji_tinymce( $plugins ) {\n	unset( $plugins[\'wpemoji\'] );\n	return $plugins;\n}\n","Simple php snippet: Disable emojis","","publish","closed","closed","","simple-php-snippet-disable-emojis","","","2019-08-28 22:03:34","2019-08-28 22:03:34","","0","http://findmaster.ca/2019/08/28/simple-php-snippet-disable-emojis/","0","wbcr-snippets","","0");
INSERT INTO wp_posts VALUES("14","1","2019-08-28 22:03:34","2019-08-28 22:03:34","<h3>What is Lorem Ipsum?</h3>Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry\'s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum.\n{{SNIPPET_CONTENT}}\n","Simple text snippet: What is Lorem Ipsum?","","publish","closed","closed","","simple-text-snippet-what-is-lorem-ipsum","","","2019-08-28 22:03:34","2019-08-28 22:03:34","","0","http://findmaster.ca/2019/08/28/simple-text-snippet-what-is-lorem-ipsum/","0","wbcr-snippets","","0");
