INSERT INTO wp_posts VALUES("47","2","2019-08-29 09:55:32","2019-08-29 16:55:32","/*мусорка синяя*/\n.rcl-public-box .rcl-service-button {\n    color: #00aff2;\n}\n/**/\n/*Ширина миатюры*/\nli#attachment-49 {\n    width: auto;\n}\n/**/\n/*скрыть значок поиска*/\nli.top-search-icon {\n    clip-path: polygon(0px 0px,0px 0px,0px 0px,0px 0px);\n}\n/**/\n\n/*убрать рамку в ЛК (информация)*/\n.uit_all_custom_field .show-profile-fields {\n    border: aqua;\n}\n/**/\n\n/*межстрочное расстояние в ЛК*/\n.show-profile-fields {\n    line-height: 2;\n}\n/**/\n\n/*цвет сердца синий*/\ni.rcli.fa-heartbeat {\n    color: #00aff2;\n}\n/**/\n\n/*убираем фон и меняем цвет ценника в списке заказов, и значков*/\n.task-meta.task-price {\n    background: #00aff200;\n    color: #00aff2;\n}\ni.rcli.fa-folder-open.rcl-icon {\n    color: #00aff2;\n    background: #7fff0000;\n}\ni.rcli.fa-clock-o.far.fa-clock.rcl-icon {\n	color: #00aff2;\n    background: #7fff0000;\n}\ni.rcli.fa-refresh.fa-sync.rcl-icon {\n	color: #00aff2;\n    background: #7fff0000;\n}\n.fng-manager.preloader-box {\n    background: #a52a2a00;\n}\n\n/**/\n\n/*скрыть кнопку редактирования профиля*/\nspan.tc_button_change {\n    clip-path: polygon(0px 0px,0px 0px,0px 0px,0px 0px);\n}\n/**/\n\n/*меняем цвет уведомления при редактировании профиля*/\n.notify-lk .success {\n    background: white;\n    border-left: 3px solid #00aff2;\n    color: #00aff2;\n}\n/**/\n\n\n","Dis","","publish","closed","closed","","dis","","","2019-08-30 11:55:38","2019-08-30 18:55:38","","0","http://findmaster.ca/?post_type=wbcr-snippets&#038;p=47","0","wbcr-snippets","","0");
