INSERT INTO wp_usermeta VALUES("66","2","about_you_12","График дня:\n\nПервый урок: 6:00 - 7:30;\nВторой урок: 8:30 - 10:00;\nТретий урок: 11:00 - 12:30;\nЧетвертый урок: 13:30 - 15:00;\nПятый урок: 16:00 - 17:30;\nШестой урок: 18:30 - 20:00;\nСедьмой урок: 21:00 - 22:30 (окончание рабочего дня).\n\nПрограмма обучения:\n\nПервый урок\n\nПрофессиональная посадка водителя, профессиональная регулировка зеркал, профессиональная работа педалями управления и рулевым колесом, трогание с газом с места и в наклоне с помощью стояночного тормоза (подъем) (инструктор в автомобиле; вторая практическая половина урока инструктор вне автомобиля рядом), самостоятельное закрепление учеником умений и навыков, полученных в ходе занятий. Если в первый урок программа усвоилась слабо, то по договоренности с учеником занятие повторяется на следующем уроке до полного овладения управлением.\n\nВторой урок\nОстановка техническая и запланированная, пользование ручным стояночным тормозом, самостоятельный выход из автомобиля с обеспечением полной безопасности.\nВторая половина урока - реальная проезжая часть с малой интенсивностью движения, начало и завершение движения, работа зеркалами, переключателем поворота (когда информировать других участников движения о своем желании перестроиться и остановиться или о начале движения или перестроении).\n\nТретий урок\n\nЗмейка вперед, разворот, подъем со стояночным тормозом и без его применения (динамичная работа педалями) для тех, у кого уже есть в/у. \nОтработка упражнения &quot;stop and go&quot;, по осям автомобиля (профессиональное понимание и умел");
